            flex-direction: row;
        }

        .order-information__content>p {
            padding: 1rem;
            box-shadow: 0 2px 2px rgba(31, 32, 32, 0.25);
        }

        table {
            width: 100%;
            table-layout: fixed;
            box-shadow: 0 02px 2px rgba(31, 32, 32, 0.25);
        }

        thead {
            background-color: rgba(217, 236, 247, 0.699);
        }

        th {
            font-weight: 400;
        }
